n d\u00edagnostico m\u00e9dico nada alentador y mi reacci\u00f3n natural fue preocuparme, pensaba permanentemente en mis hijos y su futuro. \nLa preocupaci\u00f3n es una forma de anticiparse a los riesgos y peligros para estar preparados y poder planificar el futuro. Pero la ciencia ha demostrado que una excesiva preocupaci\u00f3n puede generar trastornos de depresi\u00f3n y ansiedad.\n\nLa buena noticia que te tengo es que seg\u00fan un estudio estadounidense realizado por la Universidad de Pensilvania el  91% de las preocupaciones de las personas no se hacen realidad. \nAs\u00ed que es necesario que conf\u00edes en Dios y no permitas que  las circunstancias del presente,  y el exceso de ansiedad socave tu fe y esperanza. No importa por lo que est\u00e9s pasando ahorita solo debes pensar en Positivo para que tu fe y determinaci\u00f3n de seguir adelante se fortalezca.\n\nToda preocupaci\u00f3n proviene de pensamientos negativos y lo que debes hacer es sustituir los pensamientos negativos por positivos aunque el entorno y el mundo entero te quiera mostrar lo contrario.\n\nEl pensar positivamente fortalece tu sistema inmunol\u00f3gico, disminuye tus niveles de estr\u00e9s y ansiedad.\n\nQuieres aprender a pensar positivamente. Te invito a mi v\u00eddeo conferencia gratuita por Zoom:\n\"El Poder de la Actitud Positiva\". En ella te dar\u00e9 consejos y herramientas pr\u00e1cticas que te ayudar\u00e1n a cambiar tu vida.\n\nSi quieres participar escribe un DM o al WhatsApp Business +58416.825.66.87\nRecuerda que solo 100 cupos disponibles. Te espero.\n\nJes\u00fas \u00c1lvarez\nHappy manager\n\n#felicidad\n#fe #amor #venezuela #caracas #bogota #santiago #mexico #nyc #miami #video #instagram #instagood\u00a0\u00a0#photooftheday #fashion #beautiful #happy #cute #tbt\u00a0\u00a0#like4like #followme\u00a0\u00a0#picoftheday\u00a0\u00a0#follow \u00a0#me\u00a0\u00a0#selfie \u00a0#summer \u00a0#instadaily \u00a0#friends\u00a0\u00a0#repost\u00a0\u00a0#smile"}}]},"shortcode":"B9x
